import { fetchPosts } from "../api/api";


const Posts = ({posts}) => {

    const [post, setPosts] = useState([]);
    return (
        <div>
            <h1>
                Check out some stuff!
            </h1>
            {posts.map(post => {
                return (
                    <div
                    key={post._id}
                    className="post-list"
                    >{post.title}</div>
                )
            })}

        </div>
    );
};

export default Posts;
